Corso Magnesium 14" – новинка 2022 года. 

Данная модель за счет магниевой рамы, магниевых дисков, магниевой вилки обладает очень легким весом, по сравнению с велосипедами на стальной раме, разница примерно составляет от 3 до 4 килограмм в зависимости от модели велосипеда.

Суперлегкая магниевая рама, литые магниевые диски, дисковые тормоза, комплектация качественным оборудованием!
Предназначен для детей возрастом от 3 до 5 лет от 90 см до 110 см.

Характеристики:
- существенно легкий вес;
- передний и задний ручной дисковый механический тормоз;
- удобные качественные грипсы руля (резиновые ручки на руле);
- эксклюзивный дизайн “CORSO”;
- уникальная матовая и глянцевая покраска;
- мягкое, комфортное сиденье из матового и глянцевого материала;
- литые магниевые диски 14”;
- безрезьбовая каретка Американского типа;
- дополнительные боковые колеса;
- звоночек на руле.

Масса Нетто: 8,9 кг
Масса Брутто: 10,2 кг.

Консультацию и более детальную информацию можно получить у консультантов.

