Продаются новые сумки-чехлы для транспортировки и хранения колясок. Сумки подходят для большинства видов колясок: от компактных колясок-тростей до крупногабаритных прогулочных колясок.
В такой сумке коляску можно сдать в аэропорту в багаж, перевозить в поезде, в багажнике автомобиля или просто хранить дома, чтобы коляска не пылилась и была защищена от попадания солнечных лучей.

Преимущества сумки-чехла для коляски:
1) сделана из плотной водонепроницаемой ткани;
2) аккуратно пошита (швы ровные, нитки не торчат);
3) есть разные размеры под большинство типов колясок;
4) компактная (складывается и хранится в небольшой сумочке, поэтому ее легко взять с собой, положив в сумку мамы или в кармашек коляски);
5) легко и плотно закрывается с помощью затягивающегося шнурка (размер M,L) или резинки (размер S);
6) имеется ручка для переноски в руках (размер M,L) или на плече (размер S);
7) легкая;
8) не маркая;
9) легко чистится, даже влажной салфеткой;
10) не имеет запаха.

Перед заказом измерьте сантиметровой лентой обхват коляски в сложенном виде по ширине в максимально широком месте. Также измерьте обхват коляски в сложенном виде по длине. Благодаря этим замерам (сравнив с описанием размеров чехлов ниже), Вы легко сможете определить нужный размер чехла для своей модели коляски.
Есть три варианта сумок-чехлов:
- S [210 грн.] – маленькая (фото 2-3). Размеры в разложенном виде: длина - 123 см, ширина возле горловины - 45 см, ширина возле дна - 33 см. Закрывается с помощью затягивающейся резинки. Есть длинная ручка для переноски на плече. Сумочки для складывания нет. Цвет: черный. Подходит только для небольших колясок-тростей, у которых максимальный обхват по ширине в сложенном виде вверху до 92 см, внизу - до 66 см; по длине - до 240 см.
- M [270 грн.] – средняя (фото 1,4,5). Размеры в разложенном виде (Д*Ш): 124*69 см. Закрывается с помощью затягивающегося шнурка. Есть ручка для переноски в руках. Есть сумочка для складывания. Цвет: черный. Подходит для большинства прогулочных колясок и колясок-тростей, у которых максимальный обхват по ширине в сложенном виде до 136 см, по длине - до 236 см.
- L [280 грн.] – большая (фото 6-7). Размеры в разложенном виде (Д*Ш): 126*86 см. Закрывается с помощью затягивающегося шнурка. Есть ручка для переноски в руках. Есть сумочка для складывания. Цвет: черный, синий, красный. Подходит для крупногабаритных колясок, у которых максимальный обхват по ширине в сложенном виде до 168 см, по длине - до 226 см.

